import React from 'react';
import { BarChart } from 'chart.js';

const myData = [
	{
		label: 'Apples',
		value: 10,
	},
	{
		label: 'Oranges',
		value: 17,
	},
];
export default function Cart() {
	return (
		<div>
			<BarChart data={myData} title="My amazing data" color="#70CAD1" />
		</div>
	);
}
